exp_rules.vi:
Thắng bài thêm Exp, thua bài giảm Exp.

Trong phòng small blind < 10M: Thắng bài thêm Exp, số Exp tăng = (số người chơi thắng) x 2;
khi thua bài giảm 1 Exp.
Trong phòng small blind >= 10M: Thắng bài thêm Exp, số Exp tăng = (số người chơi thắng) x 4;
khi thua bài giảm 2 Exp.

exp_rules.en:
Winning a hand increases EXP, losing a hand decreases EXP.

In rooms with small blind < 10M: Win to gain EXP = (number of winners) x 2;
losing reduces EXP by 1.
In rooms with small blind ≥ 10M: Win to gain EXP = (number of winners) x 4;
losing reduces EXP by 2.
